import React from "react";
import "./popular_slide.css"
import Slider from "react-slick";
import "~slick-carousel/slick/slick.css"; 

const PopularSlide = () => {
    const settings = {
        className: "center",
        centerMode: true,
        infinite: true,
        centerPadding: "60px",
        slidesToShow: 3,
        speed: 500
      };

    return (
        <div className="body_popular">

        <h2>Center Mode</h2>
        <Slider {...settings}>

        </Slider>
      </div>

    )
}

export default PopularSlide;
